import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Header.css'; // Custom CSS for the retro header
import { Link } from 'react-router-dom';

function Header() {
    return (
        <nav className="navbar retro-header">
            <div className="container">
                {/* Left Links */}
                <div className="navbar-nav">
                    <Link className="nav-link retro-link" to="/resume">Resume</Link>
                    <Link className="nav-link retro-link" to="/portfolio">Portfolio</Link>
                </div>

                {/* Right Name */}
                <div className="ml-auto">
                    <span className="navbar-text retro-title">
                        Larson Evans
                    </span>
                </div>
            </div>
        </nav>
    );
}

export default Header;
